import React from 'react'
import classes from "../../css/item.module.css"
function Item(props) {
  return (
    <div className={classes.item}>
              <span>
                {props.productName}
              </span>

              <span>
                {props.productPrice}
              </span>
    </div>
  )
}

export default Item
